import React from 'react';
import './Navbar.css';


function Navbar() {
  return (
    <header>
        <nav className='navbar'>
            <a href="/" className='navbar-brand'>My Website</a>
            <div className='navbar-col'></div>
        </nav>

    </header>
  )
}

export default Navbar
